        $nombre = $_POST['nombre_log'];
        $password = $_POST['password_log'];

        $db = new Database();
        $query = $db->connect()->prepare('SELECT * FROM users WHERE nombre_db = :username AND password_db = :userpassword');
        $query->execute(['username' => $nombre, 'userpassword' => $password]);

        $row = $query->fetch(PDO::FETCH_NUM);

        if($row == true){
            $rol = $row[3];

            $_SESSION['rol'] = $rol;
